import React from "react";
import "../styles/home.css";
import { Container, Row, Col } from "reactstrap";
import heroImg from "../assets/images/hero-img01.jpg";
import heroImg2 from "../assets/images/hero-img02.jpg";
import heroVid from "../assets/images/hero-video.mp4";
import worldImg from "..//assets/images/world.png";
import Subtitle from "../shared/Subtitle";
const Home = () => {
  return (
    <>
      {/*hero section start*/}
      <section>
        <Container>
          <Col lg="6">
            <div className="hero__content">
              <div className="hero__subtitle d-flex align-items-center">
                <Subtitle subtitle={"Know Before You Go"} />
                <img src={worldImg} alt="" />
              </div>
              <h1>
                Traveling opens the door to creating{" "}
                <span className="highlight">memories</span>
              </h1>
              <p>
                Vịnh Hạ Long là một di sản thiên nhiên thế giới nằm ở tỉnh Quảng
                Ninh, Việt Nam, nổi tiếng với cảnh quan hùng vĩ của hàng ngàn
                hòn đảo đá vôi lớn nhỏ rải rác trên mặt nước xanh biếc. Các hòn
                đảo này được hình thành từ hàng triệu năm trước, tạo nên những
                hang động kỳ ảo và những dãy núi đá sừng sững. Không chỉ thu hút
                du khách bởi vẻ đẹp thiên nhiên độc đáo, Vịnh Hạ Long còn mang
                trong mình những giá trị lịch sử, văn hóa lâu đời, là nơi sinh
                sống của nhiều loài sinh vật quý hiếm. Du thuyền trên Vịnh Hạ
                Long vào lúc bình minh hay hoàng hôn là trải nghiệm tuyệt vời,
                mang đến cảm giác thư thái và ấn tượng khó quên.
              </p>
            </div>
          </Col>
        </Container>
      </section>
      {/*hero section start*/}
    </>
  );
};

export default Home;
